import style from './Header.module.css';
const Header = () => {

    return ( <
        header >
        <
        h1 className = {
            style['logo']
        } > Hschool < /h1>

        <
        div className = {
            style['header-buttons']
        } >
        <
        div className = {
            style['nightmode']
        } > < /div> <
        p className = {
            style['contact']
        } > contact < /p> <
        p className = {
            style['language']
        } > en < /p> <
        div className = {
            style['signup-button']
        } >
        <
        p className = {
            style['sign-text']
        } > Sign Up < /p> <
        /div> <
        div className = {
            style['login-button']
        } >
        <
        p className = {
            style['login-text']
        } > Login < /p> <
        /div> <
        /div> <
        /header>
    );
};

export default Header;
